import React, {Component} from 'react';
import {Form, Input, Space} from "antd";
import registerStyle from './index.module.css'

const formItemLayout = {
    labelCol: {
        xs: { span: 24 },
        sm: { span: 5 },
    },
    wrapperCol: {
        xs: { span: 24 },
        sm: { span: 16 },
    },
}

class Sign extends Component {
    render() {
        return (
            <div className={registerStyle.frame}>
                <h2 className={registerStyle.title}>企业用户注册</h2>
                <Form name='register' scrollToFirstError {...formItemLayout}>
                        <Form.Item name='orgCode' label='组织机构代码'>
                            <Input/>
                        </Form.Item>
                        <Form.Item name='orgName' label='企业名称'>
                            <Input/>
                        </Form.Item>
                </Form>
            </div>
        );
    }
}

export default Sign;
